import * as React from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import TextField from '@mui/material/TextField';
import { Avatar, Button, Checkbox, FormControlLabel, Grid, Paper } from '@mui/material';
import LockIcon from '@mui/icons-material/Lock';
import './login.scss'

const Login = () => {
    const paperStyle = { padding: 20, height: '70vh', width: 280, margin: "20px auto" }
    const avatarStyle = { backgroundColor: '#1bbd7e' }
    const textStyle = {paddingtop: 20}
    return (
        <>
            <Grid>
                <Paper elevation={10} style={paperStyle}>
                    <Grid align='center' className='header'>
                        <Avatar style={avatarStyle}><LockIcon/></Avatar>
                        Sign In
                    </Grid>
                    <TextField label='Username' placeholder='Enter username' variant='standard' style={textStyle} fullWidth required />
                    <TextField label='Password' placeholder='Enter password' variant='standard' className='textField'  type='password' fullWidth required />

                <FormControlLabel 
                control={
                    <Checkbox name='checkB' className='textField'  color='primary'/>
                }
                label='Remember me'/>
                    <Button type='submit' className='textField'  color='primary' fullWidth variant='contained'>Sign In</Button>
                </Paper>
            </Grid>
        </>
    );


}

export default Login
